contracts/Aliens.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import '@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import '@openzeppelin/contracts/utils/Counters.sol';

contract Aliens is ERC721, ERC721Burnable, Ownable {
  using Counters for Counters.Counter;
  Counters.Counter private idCounter;

  uint256 private mintCost = 10 ether;
  uint256 private gasBack = 0.01 ether;
  uint256 private maxStrength = 10;
  string private baseUri = '';

  struct AlienRace {
    uint256 strength;
    uint256 createdAtBlock;
  }
  mapping(uint256 => AlienRace) public alienRaces;

  constructor() ERC721('Aliens', 'ALN') {
    // Premint 4 to aliens to creator
    uint8[4] memory strengths = [1, 2, 2, 2];
    for (uint256 i = 0; i < 4; i++) {
      _safeMint(msg.sender, idCounter.current());
      alienRaces[idCounter.current()] = AlienRace(strengths[i], block.number);
      idCounter.increment();
    }
  }

  function getMintCost() public view returns (uint256) {
    return mintCost;
  }

  function setGasBack(uint256 newGasBack) public onlyOwner {
    gasBack = newGasBack;
  }

  function setMintCost(uint256 newCost) public onlyOwner {
    mintCost = newCost;
  }

  function setAlienStrength(uint256 tokenId) public {
    // Only allow strength to be set once
    require(alienRaces[tokenId].strength == 0, 'Aliens: strength already set');
    uint256 nextBlockNumber = alienRaces[tokenId].createdAtBlock + 1;
    bytes32 nextBlockhash = blockhash(nextBlockNumber);
    uint256 randomStrength = uint256(nextBlockhash) % maxStrength;
    alienRaces[tokenId].strength = randomStrength;
  }

  function getAlienStrength(uint256 tokenId) public view returns (uint256) {
    return alienRaces[tokenId].strength;
  }

  function mint(address payable recipient) public payable {
    require(msg.value == mintCost, 'Aliens: value must be mint cost');
    _safeMint(recipient, idCounter.current());
    alienRaces[idCounter.current()] = AlienRace(0, block.number);
    alienRaces[idCounter.current()].createdAtBlock = block.number;
    idCounter.increment();
    // Give user money for gas
    (bool gasSent, ) = recipient.call{value: gasBack}('');
    require(gasSent, 'Aliens: Failed to reimburse');
  }

  function setBaseUri(string memory _baseUri) public onlyOwner {
    baseUri = _baseUri;
  }

  function baseTokenURI() public view returns (string memory) {
    return baseUri;
  }

  receive() external payable {
    (bool sent, ) = owner().call{value: msg.value}('');
    require(sent, 'Aliens: Failed to pass on value');
  }
}

contracts/BattlefieldEarth.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import '@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol';
import '@openzeppelin/contracts/token/ERC1155/utils/ERC1155Holder.sol';
import '@openzeppelin/contracts/access/Ownable.sol';
import './interfaces/IAliens.sol';
import './interfaces/IEquipment.sol';

contract BattlefieldEarth is ERC721Holder, ERC1155Holder, Ownable {
  IAliens private aliensContract;
  IEquipment private equipmentContract;

  uint8 private constant FUEL = 0;
  uint8 private constant REWARD = 1;

  struct AlienOnPlanet {
    uint256 tokenId;
    address owner;
  }

  AlienOnPlanet[] private aliensOnPlanet;

  constructor() {}

  function populatePlanet() public onlyOwner {
    require(
      aliensOnPlanet.length == 0,
      'BattlefieldEarth: Planet already populated'
    );
    // Start planet with 4 existing aliens
    for (uint256 i = 0; i < 4; i++) {
      aliensContract.safeTransferFrom(msg.sender, address(this), i);
      aliensOnPlanet.push(AlienOnPlanet(i, msg.sender));
    }
  }

  function setAliensContract(address _aliensContract) public onlyOwner {
    aliensContract = IAliens(_aliensContract);
  }

  function setEquipmentContract(address _equipmentContract) public onlyOwner {
    equipmentContract = IEquipment(_equipmentContract);
  }

  function rewardCurrentInvaders(uint256 excludeToken) internal {
    // Reward existing aliens with fuel
    for (uint256 i = 0; i < aliensOnPlanet.length; i++) {
      if (aliensOnPlanet[i].tokenId != excludeToken) {
        equipmentContract.reward(aliensOnPlanet[i].owner, REWARD, 1);
      }
    }
  }

  function sellRewardTokens(uint256 numberOfTokens) public {
    equipmentContract.burn(msg.sender, REWARD, numberOfTokens);
    uint256 totalNumberOfTokens = equipmentContract.totalSupplyOf(REWARD);
    uint256 rewardValue = address(this).balance / totalNumberOfTokens;
    (bool sent, ) = msg.sender.call{value: rewardValue}('');
    require(sent, 'Battlefield: Failed to reimburse');
  }

  function attack(uint256 _tokenId) public {
    // Move alien to planet and burn fuel
    aliensContract.safeTransferFrom(msg.sender, address(this), _tokenId);
    equipmentContract.burn(msg.sender, FUEL, 1);

    // Send weakest alien back to owner
    uint256 weakestAlienIndex = getWeakestAlienIndex();
    aliensContract.safeTransferFrom(
      address(this),
      aliensOnPlanet[weakestAlienIndex].owner,
      aliensOnPlanet[weakestAlienIndex].tokenId
    );
    // Replace weakest alien from planet with new comer
    AlienOnPlanet memory newAlien = AlienOnPlanet(_tokenId, msg.sender);
    aliensOnPlanet[weakestAlienIndex] = newAlien;
    rewardCurrentInvaders(_tokenId);
  }

  function getAliens() public view returns (AlienOnPlanet[] memory) {
    return aliensOnPlanet;
  }

  function getWeakestAlienIndex() internal view returns (uint256) {
    uint256 weakestAlienStrength;
    uint256 weakestAlienIndex;
    for (uint256 i = 0; i < aliensOnPlanet.length; i++) {
      uint256 alienStrength = aliensContract.getAlienStrength(
        aliensOnPlanet[i].tokenId
      );
      if (alienStrength < weakestAlienStrength) {
        weakestAlienStrength = alienStrength;
        weakestAlienIndex = aliensOnPlanet[i].tokenId;
      }
    }
    return weakestAlienIndex;
  }

  receive() external payable {
